                        }    else if (solUpdate == "1")
                        {
                        var arrayTextSolution = getDBValue("select text from request_text where request_id = "+"'"+incidentID +"'" + " and user_def1 = "+"'"+ currentSolutionID +"'");
                        if (arrayTextSolution != currentSolution)
                            {
                            setDBValue("UPDATE request_text SET text ="+"'"+currentSolution +"'"+",modified_by = "+"'"+logInPerson +"'"+" where request_id = "+"'"+incidentID +"'" + " and user_def1 = "+"'"+ currentSolutionID +"'");
